import React from 'react';
import { MdComment } from 'react-icons/md';

const MyFunction = () => {
  fetch(`https://jsonplaceholder.typicode.com/comments?postId=1`);
};

const PostLink = (props) => {
    return (<div>{props.postid}</div>);
};

export default PostLink
